import React from 'react';
import './App.css';
import Game from "./game/Game";
import Player1 from "./Player1";
import Player2 from "./Player2";

function App() {
  return (
    <div className="App">
      <Game />
      <Player1 />
      <Player2 />
    </div>
  );
}

export default App;
